import style from "./home.module.css";
export const Home = () => {
  return (
    <div>
      <div className={style.text__container}>
        <span className={style.text}>
        <code> <span className={style.span}> &lt;</span>&lt;span&gt;

        Hola, me llamo ¡Alexandra Jiménez!, soy desarrollador de software.
&lt;span&gt;</code>


        </span>
      </div>
    </div>
  );
};
